import React from 'react';
import Dialog from '@material-ui/core/Dialog';
import {
    Card,
    CardHeader,
    CardContent,
    CardActions,
    Divider,
    Grid,
    Button,
    TextField
} from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';
import styles from './styles';

const AddMemberDialog = props => {
    const { open, handleCloseDialog, classes } = props;
    const handleClose = () => {
        handleCloseDialog(false);
    };
    return (
        <Dialog
            open={open}
            onClose={handleClose}
            aria-labelledby="draggable-dialog-title"
        >
            <div className={classes.root}>
                <Card>
                    <form autoComplete="off" noValidate>
                        <CardHeader title="Add class" />
                        <Divider />
                        <CardContent>
                            <Grid container spacing={2}>
                                <Grid item md={6} xs={12}>
                                    <TextField
                                        fullWidth
                                        label="Class name"
                                        margin="dense"
                                        name="tenlop"
                                        variant="outlined"
                                        required
                                        // onChange={handleChange}
                                        // error={errors.tenlop ? true : false}
                                        // helperText={
                                        //     errors.tenlop
                                        //         ? errors.tenlop
                                        //         : null
                                        // }
                                    />
                                </Grid>
                                <Grid item md={6} xs={12}>
                                    <TextField
                                        fullWidth
                                        label="Description"
                                        margin="dense"
                                        name="mota"
                                        required
                                        variant="outlined"
                                        // onChange={handleChange}
                                        // error={errors.mota ? true : false}
                                        // helperText={
                                        //     errors.mota ? errors.mota : null
                                        // }
                                    />
                                </Grid>
                            </Grid>
                        </CardContent>
                        <Divider />
                        <CardActions>
                            <Grid
                                container
                                direction="row"
                                justify="flex-end"
                                alignItems="flex-end"
                            >
                                <Button
                                    type="submit"
                                    color="primary"
                                    // onClick={handleClickAddClass}
                                    // disabled={loadingButton ? true : false}
                                >
                                    Save
                                    {/* {loadingButton ? <LoadingButton /> : null} */}
                                </Button>
                                <Button onClick={handleClose} color="secondary">
                                    Cancel
                                </Button>
                            </Grid>
                        </CardActions>
                    </form>
                </Card>
            </div>
        </Dialog>
    );
};
export default withStyles(styles)(AddMemberDialog);
